import React, { Component } from 'react';
import InputClient from '../components/Devis/inputClient.js';
import InputAdress from '../components/Devis/inputAdress.js';

import { DatePicker } from 'antd';
import moment from 'moment';

const { MonthPicker, RangePicker } = DatePicker;

const dateFormat = 'YYYY/MM/DD';
const monthFormat = 'YYYY/MM';

const dateFormatList = ['DD/MM/YYYY','DD/MM/YY']

export default class Devis extends Component {


    componentDidMount() {

    }

    render() {

        return (
            <div className="container">
                <div className='row' style={{ marginTop: '2%' }}>
                    <div className="col-3"><InputClient /></div>
                    <div className="col-3"><InputAdress /></div>
                    <div className="col-3 ">
                    <div class="input-group mb-3 AutocompleteText">
                        <select class="custom-select" id="inputGroupSelect01">
                            <option selected>Choisir une devise...</option>
                            <option value="Dollar">Dollar</option>
                            <option value="Euros">Euros</option>
                            <option value="Livre">Livre sterling</option>
                            <option value="Yen">Yen</option>

                        </select>
                        </div>
                    </div>
                    <div className="col-3 AutocompleteText">
                        <DatePicker defaultValue={moment('2019/01/01', dateFormat)} format={dateFormat} />
                    </div>
                    </div>
                </div>
        )
    }
}
